import {
  Box,
  FormControl,
  InputLabel,
  OutlinedInput,
  Stack,
  Typography,
} from "@mui/material";
import { styled } from "@mui/system";
import React, { useState } from "react";

function MyLogin() {
  const MyBox = styled(Box)({
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
  });

  const [values, setValues] = useState({
    email: "",
    password: "",
    showPassword: false,
  });

  return (
    <>
      <MyBox>
        <MyBox>
          <Typography variant="button">Veuillez vous identifier</Typography>
        </MyBox>
        <MyBox>
          <Stack spacing={2}>
            <FormControl>
              <InputLabel>Email</InputLabel>
              <OutlinedInput />
            </FormControl>
            <FormControl>
              <InputLabel>Password</InputLabel>
              <OutlinedInput />
            </FormControl>
          </Stack>
        </MyBox>
      </MyBox>
    </>
  );
}

export default MyLogin;
